import React from "react";
import styled from "styled-components";
import Header from "../Common/Header/Header";
import NavHeader from "../Common/Header/NavHeader/NavHeader";
import Layouts from "../Common/Layout";

export default function Detail() {
  return (
    <>
      {/* <Header> */}
      <NavHeader />
      <Layouts>
        <DetailWrap>
          <DetailImg />
          <DetailInfo>
            <ProductName>
              <h2>상품이름</h2>
              <button style={{ width: "40px", height: "40px" }}></button>
            </ProductName>
            <ProductDesc>내림차순</ProductDesc>
            <ProductPriceWrap>
              <span>가격</span>
              <span> 원</span>
            </ProductPriceWrap>
            <Discount>
              <span>가격</span>
              <span>할인</span>
            </Discount>
            <ProductDelivery>
              <span>배송</span>
              <DeliveryInfo>
                <p>배송</p>
                <br />
                <p>
                  23시 전 주문시 내일 아침 7시 전 도착
                  <br />
                  (대구·부산·울산 샛별배송 운영시간 별도 확인)
                </p>
              </DeliveryInfo>
            </ProductDelivery>
            <ProductCategoryWrap>
              <span>구분</span>
              <span>카테고리</span>
            </ProductCategoryWrap>
            <ProductUnit>
              <span>판매단위</span>
              <span>1개</span>
            </ProductUnit>
            <ProductSeller>
              <span>판매자</span>
              <span>컬리</span>
            </ProductSeller>
            <ProductUI>
              <ProductTotal>
                <span>총 상품금액: </span>
                <span>가격</span>
                <span>원</span>
              </ProductTotal>
              <ButtonWrap>
                <LikeButton>
                  {/* <img src="data:image/svg+xml;base64," /> */}
                  {/* <img src="data:image/svg+xml;base64,"/> */}
                </LikeButton>
                <BellButton>
                  {/* <img src="data:image/svg+xml;base64," /> */}
                </BellButton>

                {/* {!userData.nickName ? (
                <>
                  <PutButton onClick={onAddCart}>장바구니 담기</PutButton>
