                        padding: "20px 80px",
                      },
                    }}
                    isOpen={modal}
                    ariaHideApp={false}
                    onRequestClose={() => setModal(false)}
                  >
                    <ModalText>로그인이 필요합니다</ModalText>
                  </Modal>
                </>
              ) : (
                <>
                  <PutButton onClick={onAddCart}>장바구니 담기</PutButton>
                  <Modal
                    style={{
                      overlay: {},
                      content: {
                        width: "700px",
