                    ariaHideApp={false}
                    onRequestClose={() => setModal(false)}
                  >
                    <ModalText>장바구니에 상품을 담았습니다.</ModalText>
                    <ModalWrap>
                      <Img src={detail?.productImage}></Img>
                      <ModalBox>
                        <ModalTitle>{detail?.productName}</ModalTitle>
                        <ModalPrice>
