                        </ModalPrice>
                      </ModalBox>
                    </ModalWrap>
                  </Modal>
                </>
              )} */}
              </ButtonWrap>
            </ProductUI>
          </DetailInfo>
        </DetailWrap>
      </Layouts>
      {/* </Header> */}
    </>
  );
}

