`;

const ProductTotal = styled.div`
  text-align: right;

  span {
    &:first-child {
      color: #333333;
      font-size: 13px;
    }

    &:nth-child(2) {
      font-size: 32px;
    }

    &:last-child {
      font-size: 20px;
    }
  }
`;

const ButtonWrap = styled.form`
  display: flex;
  margin-top: 67px;
`;

const LikeButton = styled.button`
  width: 56px;
  height: 56px;
  border: 1px solid rgb(221, 221, 221);
  background-color: #ffffff;
  border-radius: 3px;
  margin-right: 8px;
